import React, {useState} from 'react';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
import './App.css';



function App() {
  const classes = useStyles();
  const [input,setInput] = useState('');

  return (
    <div className="App">
      <h1>Hello </h1>
      <input />
      <Button
        variant="contained"
        color="primary"
        className={classes.button}
      >
        Send
      </Button>
    </div>
  );
}

export default App;
